=head1 DESCRIPTION

Contains information about an unused access finding for an IAM user
access key. IAM Access Analyzer charges for unused access analysis
based on the number of IAM roles and users analyzed per month. For more
details on pricing, see IAM Access Analyzer pricing
(https://aws.amazon.com/iam/access-analyzer/pricing).

=head1 ATTRIBUTES


=head2 B<REQUIRED> AccessKeyId => Str

The ID of the access key for which the unused access finding was
generated.


=head2 LastAccessed => Str

The time at which the access key was last accessed.



